import React, { useState } from 'react';
import axios from 'axios';
import { Form, Button, Alert, Card } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

const BACKEND_URL = process.env.REACT_APP_BACKEND_URL || 'http://localhost:3001';

function CrearEquipo({ onEquipoCreado }) {
  const [form, setForm] = useState({
    nombre: '',
    descripcion: '',
    ubicacion: '',
    responsable: '',
    estado: 'activo',
    categoria: 'campo'
  });
  const [mensaje, setMensaje] = useState('');
  const [exito, setExito] = useState('');
  const navigate = useNavigate();

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async e => {
    e.preventDefault();
    setMensaje('');
    setExito('');
    try {
      await axios.post(`${BACKEND_URL}/api/equipos`, form);
      setExito('Â¡Equipo creado correctamente!');
      setForm({
        nombre: '',
        descripcion: '',
        ubicacion: '',
        responsable: '',
        estado: 'activo',
        categoria: 'campo'
      });
      if (onEquipoCreado) onEquipoCreado();
      setTimeout(() => {
        setExito('');
        navigate('/inventario');
      }, 1200);
    } catch (error) {
      setMensaje('Error al crear el equipo');
    }
  };

  return (
    <Card className="mb-4">
      <Card.Header>
        <h5 className="mb-0">Registrar Nuevo Equipo</h5>
      </Card.Header>
      <Card.Body>
        {exito && <Alert variant="success">{exito}</Alert>}
        {mensaje && <Alert variant="danger">{mensaje}</Alert>}
        <Form onSubmit={handleSubmit}>
          <Form.Group className="mb-2">
            <Form.Label>Nombre</Form.Label>
            <Form.Control name="nombre" value={form.nombre} onChange={handleChange} required />
          </Form.Group>
          <Form.Group className="mb-2">
            <Form.Label>DescripciÃ³n</Form.Label>
            <Form.Control name="descripcion" value={form.descripcion} onChange={handleChange} />
          </Form.Group>
          <Form.Group className="mb-2">
            <Form.Label>UbicaciÃ³n</Form.Label>
            <Form.Control name="ubicacion" value={form.ubicacion} onChange={handleChange} />
          </Form.Group>
          <Form.Group className="mb-2">
            <Form.Label>Responsable</Form.Label>
            <Form.Control name="responsable" value={form.responsable} onChange={handleChange} />
          </Form.Group>
          <Form.Group className="mb-2">
            <Form.Label>Estado</Form.Label>
            <Form.Select name="estado" value={form.estado} onChange={handleChange}>
              <option value="activo">Activo</option>
              <option value="inactivo">Inactivo</option>
            </Form.Select>
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>CategorÃ­a</Form.Label>
            <Form.Select name="categoria" value={form.categoria} onChange={handleChange}>
              <option value="campo">Campo</option>
              <option value="central">Central</option>
            </Form.Select>
          </Form.Group>
          <Button type="submit" variant="primary">Registrar Equipo</Button>
        </Form>
      </Card.Body>
    </Card>
  );
}

export default CrearEquipo;
